def preprocess(sentence):
    return [i.lower() for i in word_tokenize(sentence)]

def get_cats(lparts):
    emos = {'ANGER': 0, 'ANX': 0, 'SAD': 0, 'POSEMO': 0, 'NEGEMO': 0, 'JOY': 0, 'FEAR': 0}
    topics = {'WORK': 0, 'MONEY': 0, 'HOME': 0, 'HEALTH': 0, 'FAMILY': 0, 'FRIEND': 0, 'POLITICAL': 0, 'PURPOSE': 0, 'ORDER': 0, 'JUSTICE': 0}
    pronouns = {'I': 0, 'WE': 0, 'OTHER': 0, 'SHEHE': 0, 'IPRON': 0}
    # count up the emotions in the tokens
    for lp in lparts:
        for k in emos:
            if k in lp:
                emos[k] += 1
        for k in topics:
            if k in lp:
                topics[k] += 1
        if 'PRONOUN' in lp:
            if 'I' in lp:
                pronouns['I'] += 1
            elif 'WE' in lp:
                pronouns['WE'] += 1
            else:
                pronouns['OTHER'] += 1
                if 'SHEHE' in lp:
                    pronouns['SHEHE'] += 1
                elif 'IPRON' in lp:
                    pronouns['IPRON'] += 1
    return emos, topics, pronouns

def get_all_liwc_parts(tokens):
    lparts = []
    for t in tokens:
        lpt = get_liwc_parts(t)
        if t in POLITICAL:
            lpt.append('POLITICAL')
        if t in POSITIVE:
            lpt.append('POSEMO')
        if t in NEGATIVE:
            lpt.append('NEGEMO')
        if t in FEAR:
            lpt.append('FEAR')
        if t in JOY:
            lpt.append('JOY')
        if t in ANGER:
            lpt.append('ANGER')
        if t in SAD:
            lpt.append('SAD')
        if t in PURPOSE:
            lpt.append('PURPOSE')
        if t in ORDER:
            lpt.append('ORDER')
        if t in JUSTICE:
            lpt.append('JUSTICE')
        lparts.append(lpt)
    return lparts

# Efficient LIWC processing
def get_liwc_parts(token):
    rep_vec = np.array([0]*len(liwc_keys))
    match_words = [set() for i in range(len(liwc_keys))]
    # for token in token_set:
    if token in liwc_words:
        rep_vec += np.array(liwc_words[token])
        for ind in np.array(liwc_words[token]).nonzero()[0]:
            match_words[ind].add(token)
    else:
        upper_lim = min(longest_stem+1, len(token)+1)
        for i in range(shortest_stem, upper_lim):
            if token[:i] in liwc_stems[i]:
                rep_vec += np.array(liwc_stems[i][token[:i]])
                for ind in np.array(liwc_stems[i][token[:i]]).nonzero()[0]:
                    match_words[ind].add(token)
    #return rep_vec.tolist(), [list(t_mw) for t_mw in match_words]
    return [liwc_keys[i] for i in range(len(liwc_keys)) if rep_vec[i] > 0]
